    def get_value(self):

            self.v1 = self.partB_v1_value.text()
            self.r1 = self.partB_R1_value.text()
            self.r2 = self.partB_R2_value.text()
            self.r3 = self.partB_R3_value.text()
            print("hello")
    def showR1properties(self):
            vv1 = float(self.v1)
            rr1 = float(self.r1)
            rr2 = float(self.r2)
            rr3 = float(self.r3)

            print("hello")
            self.rrr1, self.rrr2, self.rrr3, self.iii1, self.iii2, self.iii3, self.vvv1, self.vvv2, self.vvv3 = calculate_exeprient_3B(vv1, rr1, rr2, rr3)
            self.Multimeter_value_displayer.setText(" R1 = {0}Ω \n V1 = {1}V \n I1 = {2}A".format(self.rrr1, self.vvv1, self.iii1))
            print(self.vvv1)
    def showR2properties(self):
            vv1 = float(self.v1)
            rr1 = float(self.r1)
            rr2 = float(self.r2)
            rr3 = float(self.r3)

            print("hello")
            self.rrr1, self.rrr2, self.rrr3, self.iii1, self.iii2, self.iii3, self.vvv1, self.vvv2, self.vvv3 = calculate_exeprient_3B(vv1, rr1, rr2, rr3)
            self.Multimeter_value_displayer.setText(" R2 = {0}Ω \n V2 = {1}V \n I2 = {2}A".format(self.rrr2, self.vvv2, self.iii2))

    def showR3properties(self):
            vv1 = float(self.v1)
